const App = () => {
  const [cart, setCart] = useState([]);
  const [search, setSearch] = useState('');

  const handleBookTicket = (event) => {
    setCart((prevCart) => [...prevCart, event]);
  };

  const handleSearchChange = (text) => {
    setSearch(text);
  };

  const filteredData = eventData.filter(event => event.name.toLowerCase().includes(search.toLowerCase()));

  const renderItem = ({ item }) => (
    <View style={styles.eventItem}>
      <Image source={{ uri: item.image }} style={styles.eventImage} />
      <View style={styles.eventDetails}>
        <Text style={styles.eventName}>{item.name}</Text>
        <Text style={styles.eventDate}>{item.date} - {item.time}</Text>
        <Text style={styles.eventPrice}>{item.price}</Text>
        <TouchableOpacity style={styles.bookButton} onPress={() => handleBookTicket(item)}>
          <Text style={styles.bookButtonText}>Book Ticket</Text>
        </TouchableOpacity>
      </View>
    </View>
  );

  return (
    <View style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <Text style={styles.headerText}>Ticket Booking</Text>
        <TouchableOpacity style={styles.cartButton}>
          <Text style={styles.cartText}>Cart ({cart.length})</Text>
        </TouchableOpacity>
      </View>

      {/* Search Bar */}
      <TextInput
        style={styles.searchBar}
        placeholder="Search for events..."
        placeholderTextColor="#ccc"
        value={search}
        onChangeText={handleSearchChange}
      />

      {/* Event List */}
      <FlatList
        data={filteredData}
        renderItem={renderItem}
        keyExtractor={(item) => item.id}
      />
    </View>
  );
};

